import Profile from "./components/Profile";
import Logo from "./Logo.vue";
export default {
  name: "the-navbar-vertical",
  props: {
    navbarColor: {
      type: String,
      default: "#fff"
    }
  },
  components: {
    //I18n,
    //NotificationDropDown,
    Profile: Profile,
    Logo: Logo
  },
  computed: {
    navbarColorLocal: function navbarColorLocal() {
      return this.$store.state.theme === "dark" && this.navbarColor === "#fff" ? "#02142b" : this.navbarColor;
    },
    verticalNavMenuWidth: function verticalNavMenuWidth() {
      return this.$store.state.verticalNavMenuWidth;
    },
    textColor: function textColor() {
      return {
        'text-white': this.navbarColor != '#02142b' && this.$store.state.theme === 'dark' || this.navbarColor != '#fff' && this.$store.state.theme !== 'dark'
      };
    },
    windowWidth: function windowWidth() {
      return this.$store.state.windowWidth;
    },
    // NAVBAR STYLE
    classObj: function classObj() {
      if (this.verticalNavMenuWidth == "default") return "navbar-default";else if (this.verticalNavMenuWidth == "reduced") return "navbar-reduced";else if (this.verticalNavMenuWidth) return "navbar-full";
    }
  },
  methods: {
    showSidebar: function showSidebar() {
      this.$store.commit('TOGGLE_IS_VERTICAL_NAV_MENU_ACTIVE', true);
    }
  }
};
